import { Card, CardActions, CardContent } from "@material-ui/core"

const Comment = (props) => {
  return (
    <div>
      <Card variant="outlined">
        <CardContent>{props.comment}</CardContent>
        <CardActions></CardActions>
      </Card>
    </div>
  )
}

export default Comment
